class Solution {
public:
    long long maximumValueSum(vector<vector<int>>& v1) {
        int n=(int)v1.size();
        int m=(int)v1[0].size();
        vector<vector<long long>> v(n,vector<long long>(m));
        for(int i=0;i<n;i++){
            for(int j=0;j<m;j++) v[i][j]=v1[i][j];
        }
        vector<vector<long long>> s;
        for(int i=0;i<n;i++){
            for(int j=0;j<m;j++){
                s.push_back({v[i][j],i,j});
            }
        }
        sort(s.rbegin(),s.rend());
        long long ans=-1e18;
        for(int i=0;i<2*n+3;i++){
            vector<vector<long long>> v2;
            for(int j=i+1;j<2*n+3;j++){
                if(s[j][1]!=s[i][1] && s[j][2]!=s[i][2]){
                    v2.push_back({s[j][0],s[j][1],s[j][2]});
                }
            }
            for(int j=0;j<min((int)v2.size(),n+2);j++){
                for(int k=j+1;k<min((int)v2.size(),n+2);k++){
                    if(v2[j][1]!=v2[k][1] && v2[j][2]!=v2[k][2]){
                        ans=max(ans,s[i][0]+v2[j][0]+v2[k][0]);
                    }
                }
            }
        }
        return ans;
    }
};
